    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + 86 + col1 NOT BETWEEN - col2 - + col2 * ( + 63 ) AND col0 * 56;
  - name: tab0

outputs:
  - name: q7744.out
    data: |
      15	81	47
      87	21	10
      97	1	99
